def slugify( name )
  name = name.downcase
  name = name.gsub( ' ', '_' )
  name = name.gsub( '/', '-' )
  name
end



attributes.each do |category,h|
  puts "  #{h.size} in #{category}"

  h.each do |name, data|
    blob = data.values.pack('c*')
    ## pp blob

    img = Image.blob( blob )

    name_slug     = slugify( name )
    category_slug = slugify( category )

